import React from 'react';


function Neutral() {
    return (
        <div>
            <h1>You have a Neutral skin tone. </h1>
            <img className='toneImg' alt="" src="https://i.pinimg.com/originals/d8/aa/0b/d8aa0b2ed608e079cdb5265ee8a9f761.jpg" />
            <h3 className='resultDescr'>If you fall under this category, you can wear just about any color as you fall inbetween having a cool and warm undertone to your skin. For foundation, you'll probably look best in formulations with a peach or beige undertone. </h3>
        </div>
    );
};



export default Neutral;
